                        return (
                            <div key={id} className="contMasterClass " style={{backgroundImage:`url(${image})`}}>
                                <p className="masterHeader">{title}</p>
                            </div>
                         ) 


            }))
            }
            </div>
        </div>
        </div>

        </div>

    )
}


